Volúmenes vivos hace referencia a las personas sin etiquetas de ningún tipo, ni de género, ni de identidad ni de expresión. Somos personas, somos volúmenes y estamos vivos.

Charla con personas pertenecientes al colectivo Trans donde nos han mostrado su realidad. Nuestro alumnado ha asistido a esta charla de una forma muy proactiva, respetando y conociendo las realidades a las que se enfrentan las personas Trans.

